import React from "react";
import "./Contacts.css";

export const Contact = () => (
  <div class="contact_page">
    <div className="papa_contact text-center">
      <div className="texto_contact">
        <h2 className="h1 display-3">SafariCO</h2>
        <h3 className="h1 display-5">WILDest dreams come true!</h3>
        <hr className="my-2" />
        <i class="fab fa-stack-overflow pr-1"></i>
      </div>
    </div>
  </div>
);
